import React, { useState, useEffect } from 'react'
import { Routes, Route, Link, Navigate, useNavigate } from 'react-router-dom'
import Members from './pages/Members'
import Schedules from './pages/Schedules'
import Payments from './pages/Payments'
import Bills from './pages/Bills'
import Repairs from './pages/Repairs'
import Login from './pages/Login'
import { logout, getAccess } from './services/auth'
import { useNotifications } from './hooks/useNotifications'

// Protected Route Component
function ProtectedRoute({ children, token }) {
  return token ? children : <Navigate to="/login" replace />
}

export default function App(){
  const [token, setToken] = useState(Boolean(getAccess()))
  const [loading, setLoading] = useState(true)
  const navigate = useNavigate()
  useNotifications() // Connect to WebSocket and listen for real-time updates

  // Re-check token when component mounts
  useEffect(() => {
    const access = getAccess()
    if (access) {
      setToken(true)
      console.log('[APP] User authenticated')
    } else {
      setToken(false)
      console.log('[APP] No token found, redirecting to login')
      navigate('/login')
    }
    setLoading(false)
  }, [navigate])

  const handleLogout = () => {
    logout()
    setToken(false)
    navigate('/login')
    console.log('[APP] User logged out')
  }

  if (loading) {
    return <div className="min-h-screen flex items-center justify-center">Loading...</div>
  }

  return (
    <div className="min-h-screen p-6 bg-gray-50">
      <header className="mb-6 bg-white p-4 rounded shadow">
        <h1 className="text-2xl font-bold mb-3">Boarding House Admin</h1>
        <nav className="flex flex-wrap gap-4">
          {token && (
            <>
              <Link to="/" className="text-blue-600 hover:underline font-medium">Members</Link>
              <Link to="/schedules" className="text-blue-600 hover:underline font-medium">Schedules</Link>
              <Link to="/payments" className="text-blue-600 hover:underline font-medium">Payments</Link>
              <Link to="/bills" className="text-blue-600 hover:underline font-medium">Bills</Link>
              <Link to="/repairs" className="text-blue-600 hover:underline font-medium">Repairs</Link>
            </>
          )}
          {!token ? <Link to="/login" className="ml-auto text-blue-600 hover:underline font-medium">Login</Link> : <button onClick={handleLogout} className="ml-auto text-red-600 hover:underline font-medium">Logout</button>}
        </nav>
      </header>
      <main className="bg-white p-6 rounded shadow">
        <Routes>
          <Route path="/login" element={<Login />} />
          <Route path="/" element={<ProtectedRoute token={token}><Members/></ProtectedRoute>} />
          <Route path="/schedules" element={<ProtectedRoute token={token}><Schedules/></ProtectedRoute>} />
          <Route path="/payments" element={<ProtectedRoute token={token}><Payments/></ProtectedRoute>} />
          <Route path="/bills" element={<ProtectedRoute token={token}><Bills/></ProtectedRoute>} />
          <Route path="/repairs" element={<ProtectedRoute token={token}><Repairs/></ProtectedRoute>} />
        </Routes>
      </main>
    </div>
  )
}
